description:
) over de geconstrueerde week

Ik deel de mening van Martina. Ik denk dat je hier specifiek wil kijken naar een evolutie. Een geconstrueerde week dient meer voor onderzoek waarvan je de resultaten kan extrapoleren. Ik zou dus ook voor de volledige periode gaan. 

Enkele dagen bij de VRT (letterlijk  of ) zullen reeds volstaan om alles te bekijken. Op  of anderhalve dag kan je de hele maand november bekijken. En hetzelfde kan dan later nog eens voor december. Ik ben er al eens geweest, bij Archief, en je kan er gebruik maken van bureau e.d. Het is er dus vrij comfortabel werken.



) ivm kant en klare turflijsten: 

Die zijn er wel. De VRT heeft er zelf gebruik van gemaakt voor hun Monitor (studiedienst: Sven Lardon of Ilse De Vroe). Wel  opm.: turflijsten stel je op in functie van de gewenste output. Ik zou dus opletten een lijst klakkeloos te gebruiken. Altijd eerst kijken of ze je wel de gewenste info zal opleveren, maw of ze wel de juiste vragen stelt.



Volgens mij staan die lijsten gewoon in de VRT-monitor (het rapport met de onderzoeksresultaten). Ik zou het voor je opzoeken als ik hier niet met allerlei deadlines zat. Kijk anders zelf eens. Je kan die rapporten gewoon downloaden bij Diverstiteit op de VRT-site.
